import {makeAutoObservable} from "mobx"

export default class DataStore{
    constructor() {
        this._tableRows = []

        this._sortColumn = []

        makeAutoObservable(this)
    }

    setTableRows(tableRows){
        this._tableRows = tableRows
    }
    get tableRows(){
        return this._tableRows
    }
}
